import React from 'react';
import { Container, Image } from 'react-bootstrap';
import '../home.css';


const Home:React.FC = () => {
    return (
     <Container className='mt-5' >
        <h1 className='header'>  Hi! I'm <br /> Ionut Ciornei </h1>
        <h5 className='style'>I am front-end developer</h5>
        <Image src="/img/me.jpg" alt="me" fluid className='imgStyle'/>
     </Container>      
    )
};

export default Home;
